import React from "react";
import './MenuItemWithDropdown.css';

function MenuItemWithDropdown(props) {
  function handleClick() {
    if (props.type === "link") {
      window.location.href = props.link;
    }
    if (props.onDropdownClick) {
      props.onDropdownClick();
    }
  }

  const isActive = false;

  return (
    <li className="li-menu">
      <button
        className={isActive ? "button-active" : ""}
        onClick={handleClick}
      >
        {props.title}
      </button>
      {props.dropdownItems && isActive && (
        <ul className="ul-dropdown">
          {props.dropdownItems.map((item) => (
            <li key={item}>{item}</li>
          ))}
        </ul>
      )}
    </li>
  );
}

export default MenuItemWithDropdown;
